The status command support two different flags. mesos m3s status
Get out live status information Usage: mesos m3s status (-h | --help) mesos m3s status --version mesos m3s status [options] <framework-id> Options: -h --help Show this screen. -k --kubernetes Give out the Kubernetes status. -m --m3s Give out the M3s status. Description: Get out live status information --kubernetes (in developing) will give out the stats of the kubernetes environment. --m3s Show the current status of the M3s services. mesos m3s status -m 2f0fc78c-bf81-4fe0-8720-e27ba217adae-0004
